import React from "react";
import Web from "../src/Images/img.png";
import Common from "./Common";

const About = () => {
  return (
    <>
      <Common name="Welcome to About Page" imgSrc={Web} visit="/contact" btnName="Contact Now"/>
    </>
  );
};

export default About;
